import React, { useState, useEffect } from "react";

function SectionCanProfileSummary() {
    const [profileSummary, setProfileSummary] = useState("");
    const [isLoading, setIsLoading] = useState(false);
    const [error, setError] = useState("");
    const [newProfileSummary, setNewProfileSummary] = useState("");

    // Fetch profile summary on component mount
    useEffect(() => {
        async function fetchProfileSummary() {
            try {
                setIsLoading(true);
                const response = await fetch("http://localhost:8080/profilesummery", {
                    method: "GET",
                    headers: {
                        "Content-Type": "application/json",
                        // Add any necessary headers, like cookies for user authentication
                    },
                });

                if (!response.ok) {
                    throw new Error("Failed to fetch profile summary");
                }

                const data = await response.json();
                setProfileSummary(data.ProfileSummary || "");
            } catch (error) {
                setError("Failed to load profile summary");
            } finally {
                setIsLoading(false);
            }
        }

        fetchProfileSummary();
    }, []);

    const handleSave = async () => {
        if (!newProfileSummary) {
            alert("Profile Summary cannot be empty");
            return;
        }

        try {
            const response = await fetch("http://localhost:8080/profilesummery", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({
                    ProfileSummary: newProfileSummary,
                }),
            });

            if (!response.ok) {
                throw new Error("Failed to update profile summary");
            }

            const data = await response.json();
            setProfileSummary(data.ProfileSummary);
            alert("Profile Summary updated successfully");
        } catch (error) {
            console.error("Error updating profile summary:", error);
            setError("An error occurred while updating profile summary");
        }
    };

    return (
        <>
            <div className="panel-heading wt-panel-heading p-a20 panel-heading-with-btn">
                <h4 className="panel-tittle m-a0">Profile Summary</h4>
                <a
                    data-bs-toggle="modal"
                    href="#Profile_Summary"
                    role="button"
                    title="Edit"
                    className="site-text-primary"
                >
                    <span className="fa fa-edit" />
                </a>
            </div>
            <div className="panel-body wt-panel-body p-a20">
                <div className="twm-panel-inner">
                    <p>
                        Your Profile Summary should mention the highlights of your career and education, what
                        your professional interests are, and what kind of a career you are looking for. Write a
                        meaningful summary of more than 50 characters.
                    </p>
                    <p>{profileSummary}</p>
                </div>
            </div>

            {/* Modal Popup */}
            <div className="modal fade twm-saved-jobs-view" id="Profile_Summary" tabIndex={-1}>
                <div className="modal-dialog modal-dialog-centered">
                    <div className="modal-content">
                        <form
                            onSubmit={(e) => {
                                e.preventDefault();
                                handleSave();
                            }}
                        >
                            <div className="modal-header">
                                <h2 className="modal-title">Profile Summary</h2>
                                <button
                                    type="button"
                                    className="btn-close"
                                    data-bs-dismiss="modal"
                                    aria-label="Close"
                                />
                            </div>
                            <div className="modal-body">
                                <p>
                                    Your Profile Summary should mention the highlights of your career and education,
                                    what your professional interests are, and what kind of a career you are looking
                                    for. Write a meaningful summary of more than 50 characters.
                                </p>
                                <div className="row">
                                    <div className="col-lg-12 col-md-12">
                                        <div className="form-group twm-textarea-full">
                                            <textarea
                                                className="form-control"
                                                placeholder="Detail of Project"
                                                value={newProfileSummary}
                                                onChange={(e) => setNewProfileSummary(e.target.value)}
                                            />
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div className="modal-footer">
                                <button type="button" className="site-button" data-bs-dismiss="modal">
                                    Close
                                </button>
                                <button type="submit" className="site-button">
                                    Save
                                </button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </>
    );
}

export default SectionCanProfileSummary;
